import React, { Component } from "react";

class Ressource extends Component {
  render() {
    return (
      <div>
        <div className="row">
          <div className="col">
            <button
              type="button"
              onClick={() => this.props.addRessource()}
              className="btn btn-raised btn-primary"
            >
              Ajouter
            </button>
          </div>
        </div>
        <div className="row">
          <div className="col" />
          <div className="col" />
          <div className="col" />
          <div className="col" />
        </div>
      </div>
    );
  }
}

export default Ressource;
